if(window.jQuery){if(typeof window.TooBasic==="undefined"){window.TooBasic={}}window.TooBasic.split=function(a){return a.split(/,\s*/)};window.TooBasic.extractLast=function(a){return window.TooBasic.split(a).pop()};$.fn.tooBasicReload=function(){var b=$(this).attr("data-toobasic-insert");if(b){console.log("TooBasic::ajaxInsert(): loading '"+b+"'");$(this).attr("data-toobasic-status","loading");var a=$(this);$.get(b,function(c){a.html(c);a.attr("data-toobasic-status","loaded")})}return $(this)};$(document).ready(function(){$("div[data-toobasic-insert]").tooBasicReload()})}else{console.log("'toobasic_asset.js' requires jQuery to be included before it.")};